    "The language used throughout this site. This site is currently available in a limited number of languages. Changing the value of this field will cause the page to refresh.": "La langue utilis\u00e9e sur le site. Ce site est actuellement disponible dans un nombre restreint de langues. En changeant la valeur de ce champ, vous rafra\u00eechirez la page.", 
